import React, { useState } from 'react';
import axios from 'axios';

function Raw() {

    const [data, setData] = useState(null);

    const handleButtonClick = async () => {
        const response = await axios.get('https://engineering-task.elancoapps.com/api/raw');
        const sortedData = response.data.sort((a, b) => a.price - b.price);
        setData(sortedData);
    };

    return (
        <div className='main'>
            <h1>Raw Data</h1>
            <button className='btn' onClick={handleButtonClick}>Get Data</button>
            {data && (
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((item) => (
                            <tr key={item.id}>
                                <td>{item.name}</td>
                                <td>{item.price}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default Raw;




